import React, { Component } from 'react';
import { Link, withRouter } from 'react-router-dom';


class New extends Component {

    constructor(props) {
        super(props)
        this.state = {
            titulo: '',
            descricao: '',
            imagem: ''
        }

    }


    render() {
        return (
            <div>
                <header id='new'><Link to='/dashboard'>Voltar</Link></header>
                <form>
                    <label>Titulo: </label><br />
                    <input type='text' placeholder='digite o titulo' value={this.state.nome} autoFocus
                        onChange={(e) => this.setState({ titulo: e.target.value })} /><br />

                    <label>Imagem: </label><br />
                    <input type='text' placeholder='cole a URL da imagem' value={this.state.imagem}
                        onChange={(e) => this.setState({ imagem: e.target.value })} /><br />

                    <label>Descrição: </label><br />
                    <input type='text' placeholder='cole a URL da imagem' value={this.state.descricao}
                        onChange={(e) => this.setState({ descricao: e.target.value })} /><br />
                </form>
            </div>
        );
    }
}

export default withRouter(New);
